import { Message, Movie, People, PersonAdd, PhotoLibrary, RssFeed } from '@material-ui/icons';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';

export enum SideMenuItemNames {
  MyPage = 'PAGE',
  Feed = 'FEED',
  Messages = 'MESSAGES',
  Friends = 'FRIENDS',
  Following = 'FOLLOWING',
  Photos = 'PHOTOS',
  Media = 'MEDIA',
}

export const sideItemsList = [
  {
    label: 'Моя страница',
    value: SideMenuItemNames.MyPage,
    icon: AccountCircleIcon
  },
  {
    label: 'Новости',
    value: SideMenuItemNames.Feed,
    icon: RssFeed 
  },
  {
    label: 'Сообщения',
    value: SideMenuItemNames.Messages,
    icon: Message 
  },
  {
    label: 'Друзья',
    value: SideMenuItemNames.Messages,
    icon: People 
  },
  {
    label: 'Подписки',
    value: SideMenuItemNames.Messages,
    icon: PersonAdd 
  },
  {
    label: 'Фото',
    value: SideMenuItemNames.Messages,
    icon: PhotoLibrary 
  },
  {
    label: 'Культпросвет',
    value: SideMenuItemNames.Messages,
    icon: Movie 
  },
];
